//import logo from './logo.svg';
import './App.css';
//import NavBar from './components/NavBar';
import Templates from './components/Templates';
//import TempList from './components/TempList';
//import {Routes, Router, Switch, Route, Link} from 'react-router-dom';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import Guide from './components/Guide';
import { BrowserRouter } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div>
            <div id="nav">
                <a href=""><img src={require('./logo.png')} alt="logo" /></a>
                <ul>
                  <BrowserRouter>
                    <Routes>
                      <Route path="/Templates" element={<Templates/>}/>
                      <Route path="*" element={<NotFound />}></Route>
                    </Routes>
                  </BrowserRouter>
                <li><a href="" className="nav1">WORKSPACE</a></li>
                <li><Link to="/Templates" className="nav1">TEMPLATE</Link></li>
                <li><Link to="/Guide" className="nav1">GUIDE</Link></li>
                <li><a href="" className="nav1">MYPAGE</a></li>
                <li><a href="" className="logoutB">logout</a></li>
                </ul> 
            </div>

        </div>

      </header>
    </div>
  );
}

export default App;
